import React from 'react';
import classes from '../styles/UIKIT/UIInput.module.scss'

interface IUIInput{
    placeholder: string;
    type: 'primary'
}

const UIInput = (props: IUIInput) => <div
    className={classes['UIInput']}
    placeholder={props.placeholder}
    >
</div>


export default UIInput;
